import React from "react";

import styles from "./Hero.module.css";

function Hero() {
  return (
    <header className={styles.header}>
      <img src="/images/weather-icon.png" alt="Weather icon" />
      <h1>Weather App</h1>
      <p>Check the current weather and forecast of any city</p>
    </header>
  );
}

export default Hero;
